description:
Kick Buttowski Season 1 Episode 2. Original Air Date February 13, 2010.



If Books Could Kill: Kick has an autographed copy of a book by his idol Billy Stumps which Gunther mistakenly returns to the library. Kick does whatever he can to get it back even though the librarian won't cooperate.



There Will Be Nachos: With their parents out of town, Brad throws a party, which Kick is not allowed to attend. This does not stop Kick from trying to get into the party to score some of Senor Brad's &quot;famous&quot; nachos. 


